import Button from "@mui/material/Button";
import "../Style/App.css";



export default function App() {
    return (
        <div className="Resource" >

            <Button
                variant="contained"
                color="primary"
                style={{ marginRight: "10px" }}
            >
                Posts
            </Button>
            <Button
                variant="contained"
                color="secondary"
                style={{ marginRight: "10px" }}
            >
                comments
            </Button>
            <Button
                variant="contained"
                color="success"

            >
                Users
            </Button>


        </div>
    );
}
